import React, { Component } from "react";

class About extends Component {
  render() {
    return (
      <div className="about-right-col" col={4}>
        <h2>Trasporti Amatrudo s.r.l.</h2>
        L'azienda Trasporti Amatrudo S.r.l. si trova in VIA ZECCAGNUOLO, 19,
        84010, San Valentino Torio, Salerno. La sua attività è Codice Ateco 2007
        (49.41) "Trasporto di merci su strada". Il report aggiornato è stato
        emesso il 28/01/2015.si occupa quotidianamente di trasporti su scala
        nazionale ed è il partner logistico ideale per tutte quelle imprese che
        hanno la necessità di ridurre i costi affidando a terzi la gestione
        tutte le proprie merci, dalla produzione al cliente finale.Il core
        business consiste principalmente in trasporto di beni primari con
        collegamenti giornalieri per tutte le regioni d'Italia e nello sviluppo
        di soluzioni di deposito e logistica integrata personalizzate secondo le
        esigenze della clientela.
        <hr />
        La forma giuridica della società Trasporti Amatrudo S.r.l. è "SOCIETA' A
        RESPONSABILITA' LIMITATA - Società di capitale".
      </div>
    );
  }
}

export default About;
